Jonas Lekšas, Karolis Tiškevičius ir Lukas Malinauskas daugiausia dėmesio skyrė kosminei Kauno „Žalgirio” savaitei Eurolygoje. Pakalbėta ir apie liūdnas naujienas dėl Domanto Sabonio bei skolingus LKL klubus. 

Tinklalaidės partneriai:
– Užsisakyk „Telia Play” ir mėgaukis mėgstamomis krepšinio rungtynėmis, kad ir kur bebūtum! Plačiau: https://www.telia.lt/privatiems/televizija?be-isipareigojimu
– ŽOLYNĖLIS – arbatos, pagamintos puoselėjant lietuviškos arbatos tradicijas. http://onelife.lt/ visą vasario mėnesį visai Žolynėlio produkcijai taikoma 40% nuolaida, o su kodu basketnews10 – suteikiama papildoma 10% nuolaida.
– Nealkoholinis alus „Gubernija”, daugiau informacijos – https://gubernija.lt

Temos:
- Gerai, kad prasidėjo laida ir kiti Basketnews reikalai (0:00);
- Lekšo, Miklovo ir Tiškevičiaus lažybos dėl Evanso (8:23);
- Siautėjanti „Žalgirio” arena ir Trinchieri efektas (17:44);
- Lauryno Biručio metimo magija (20:50);
- Įspūdingas žaidėjas Kendrickas Nunnas (24:57);
- Dovydui Giedraičiui vietą užleidęs Lekavičius (27:20);
- Kritusi Dimšos ir Šmito nauda „Žalgiriui” (30:21);
- Eurolygos grandų dėmesio sulaukęs Manekas (31:20);
- Sumnerio bėdos, žalgiriečių kovingumas ir super pasiekimas (33:42);
- Komiška Hernangomezo gynyba ir Lessorto vaidyba (36:02);
- Grigonio benefisas ir tragiškas teisėjavimas (37:20);
- Jautrus Grigonio vizitas ir viltys grąžinti jį į „Žalgirį” (42:35);
- Paskaičiuokime – tai kiek reikia tų pergalių? (50:50);
- Pasikeitę „Žalgirio” skaičiai ir kiti Eurolygos flagmanai (56:43);
- Kas vyksta – Domantas Sabonis nežais „All Stars” (1:01:57);
- Kaip gyvensim dvi savaites be Eurolygos? (1:08:00);
- Į BN  sugrįžęs Milaševičius ir kuo skiriasi Prienai nuo Gargždų? (1:10:40).

